import { Card } from 'react-bootstrap';
// import { BsHeart, BsHeartFill } from 'react-icons/bs';
import { Link } from 'react-router-dom';
import Moment from 'react-moment';

function ProductCard({ params }) {
    return ( <
        Card >
        <
        Link to = { `/categories/land/${params[1]}/details` } >
        <
        Card.Img variant = "top"
        src = { params.image }
        /> <
        Card.Body >
        <
        Card.Title > { params.title } < /Card.Title> <
        Card.Text > {
            (params.price).toFixed(2) }â‚¬ < /Card.Text> <
        /Card.Body> <
        /Link> <
        Card.Footer >
        <
        small className = "text-muted" >
        <
        Moment format = "d MMM YYYY (dddd) HH:mm" > { params.addedAt } <
        /Moment> -
        < strong > { params.city } < /strong> { /* <Link to="" id="heartIcon"><BsHeart /></Link> */ } <
        /small> <
        /Card.Footer> <
        /Card>
    )
}

export default ProductCard;
